import React from 'react';
import './cta.css'

const Cta = () => {
    return (
        <div className='gpt3__cta section__padding'>
            <div className='gpt3__cta-content'>
                <p>Request early access to get started</p>
                <h3>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Veritatis, vero?</h3>
            </div>
            <div className='gpt3__cta-button'>
                <button type="button" className='gpt3__cta-btn'>Get Started</button>
            </div>
        </div>
    );
};

export default Cta;
